import axios from "axios";
import authHeader from "./auth-header";
import { API_URL } from "./constants";

const getProjects = () => {
  console.log(authHeader());
  return axios.get(API_URL + "api/clients", { headers: authHeader() });
};

export default {
  getProjects,
};
